(1851, 53, 1, 'sell', 'Kitvision Escape HD5 720p HD Waterproof Action Camera/Action Cam with Mounting Accessories, 30 fps/5 MP, HD Video with Single Shot, Timed, Burst and Time Lapse Photo Modes, Waterproof Up to 30 m Description Product Description Go explore with the Escape HD5 Action Camera. Record in high definition 720p resolution, snap 5 megapixel photos and take your action camera down to 30 m with its waterproof case. Kitvision Escape HD5 Action Camera Find adventure with the Escape HD5 action camera and record life in high definition and no matter where the action takes you, capture it all. Say yes to new adventures and firsts, the smooth rides and the bumpy ones and create stories that will last a lifetime. Plan and view the shot The Escape\'s 720p HD video and built-in display means you can line up the ideal shot at a moment\'s notice as well as snap images of 5 megapixel. Escape the norm, break the mould and say yes to adventure. Action Camera Accessories and Mounts Kitvision\'s Escape action cameras all come with a range of accessories and mounts that are compatible with all Kitvision and GoPro action cameras, so now there\'s no excuse not to try it all. You\'re ready for every adventure, land or sea, so dive in up to 30 m with the waterproof case, take on the slopes, use the helmet mount and turn your action cam into a helmet camera or record that first bike ride with the bicycle mount. Do it all and do more with the Kitvision Escape HD5 action camera. About Kitvision Kitvision\'s mission is to inspire real people to say yes. To getting out there, having a go and letting that adventurer inside you break free. To try the things you\'ve always wanted to try, experience the new, embrace the past and say yes to facing fears; big and small. Specifications: Display: 2 Inch LCD Lens: 120 Degree HD wide-angle lens Video Resolution: 720p at 30 fps/WVGA 480p at 30 fps Video Format: AVI Photo Resolution: Up to 5 megapixel Storage: Micro SD (up to 32 GB Class 10 r