(2546, 117, 1, 'sell', 'World-class Sound with Digital Convenience Blue\'s Spark Digital USB condenser microphone/iOS interface takes the acclaimed design of Blue\'s Spark condenser microphone, and adds USB connectivity for your Apple iOS device or any USB-equipped computer. Now you can make studio-quality recordings anywhere you take your iOS device! Spark Digital features zero-latency headphone monitoring, an adjustable gain control, a mute function, and a Focus control to select from two mic voicings. It\'s ideal for recording vocals, acoustic instruments, and just about anything else you\'d normally use a high-quality condenser microphone for. Whether you need a top-notch mic for producing with your iOS device, or just want the simplicity of plugging into your Mac or PC with just a USB cable, you\'ll love the results you get from the Blue Spark Digital USB condenser microphone and iOS interface! Studio-quality recordings made easy Blue knows that if you want to make a great recording, you need to capture a great source with a great mic. The Spark Digital sports the same exceptional sonic quality of the original Spark studio microphone, but with the convenience of a direct digital connection. Just one cable from your Spark Digital microphone to your computer or iOS device, and you\'re ready to capture stellar audio recordings. Based on Blue\'s acclaimed Spark microphone Blue\'s Spark condenser microphone was acclaimed for bringing you pro-quality sound at a very affordable price, and the Spark Digital brings the same vibrant sound to your iOS device or USB-equipped computer. Spark Digital even has the Focus switch found on the Spark, which lets you select from two different voicings to suit whatever you\'re recording - it\'s like having two mics in one! Use with your Mac or iOS device Spark Digital has two digital outputs, a USB connection for your computer as well as a Lightning connector for your Apple iOS device. There\'s also a headphone output on the Spark Digital for monitoring while you record, so you can have a studio-like recording experience anywhere you go. SPECIFICATION Studio-quality condenser microphone with USB output for your computer and Lightning output for your Apple iOS device Wide frequency response, well balanced with plenty of detail Focus switch lets you switch between two different mic voicings for extra versatility Built-in headphone monitoring Includes desktop stand Works with USB-equipped Mac or PC Includes Blue\'s Cloud Production Bundle for audio back-up and sharing online We sell also Yamaha , Behringer , Korg, PA1000, Iphone , iPad, Logitech , Corsair , Acer ,PA1000MG , Studio interface , Audio Card , Microphone , Monitor , VSTi , Daw softwares , Boss , Alessis , Arabic Scale tunning , alesis, Alto , Midibeam , Maudio , Ketron , KRK , Montarbo , Roland , MRT audio,akai,Roland,m-audio,Marantz,sound system,lighting,keyboard.casio, Sony PS4 , Nintendo ,Wii , Xbox , Razer, Alienware , Jbl , Beats , Jabra , Bose , Sony headphones , Nikon ,Pioneer , Samsung , Gaming accessories , Asus laptop , Sony VR , VR headset , gaming , BMW, Marcedes , HyundaiKia,thrustmater,sades, and many good stuff<br><table class=\"scrap_ads_table\"><th>heading</th><th>value</th><tr><td>Condition</td><td>New</td></tr><tr><td>Type</td><td>Others</td></tr></table>', 'Blue Microphones Spark Digital - Lightning', 'blue-microphones-spark-digital---lightning-2546', 'Angola', '', 'Luanda', '305-hiu Street 611, Luanda Angola', '-8.8383', '13.2344', 163727.75, 'AOA', 1, '0', 0, 0, NULL, 0, NULL, NULL, NULL, NULL, '2020-12-29 14:41:22', '2020-12-31 11:44:06', NULL, 'Ashako', NULL, NULL),
(2547, 117, 1, 'sell', 'Great vintage mic tone from BLUE! The BLUE Bottle Rocket Stage 1 is a transformerless Class A microphone with a sound all its own. It comes with a B8 capsule - the same capsule used in Blue\'s popular Bluebird - as well as the custom shockmount and an ATA-style flight case. Great for recording vocals, electric guitars, acoustic guitars, strings, drums, woodwinds, and more, you get impressive versatility and, of course, impeccable BLUE quality with the Bottle Rocket Stage 1. Fully compatible with Bottle Caps, BLUE\'s interchangable capsule system, you can add an array of tonal characteristics and pickup patterns to your BLUE Bottle Rocket Stage 1! Great for recording a variety of sources With the BLUE Bottle Rocket Stage 1 in your mic closet, you can rest assured - you\'ve got an incredibly versatile mic, ready to tackle nearly any source. On vocals, you can get a \"big\" vocal sound, without worrying about overloading the mic, an incredible clean guitar sound on your electric amp, and a well-suited shimmering high-end on acoustics! With its natural highs and soft midrange characteristics, your Type B can handle nearly any member of the bowed string family, and its extended high end delivers a modern tonality when miking saxophones and other wind instruments! Compatible with BLUE Bottle Caps Expanding the possibilities of your BLUE Bottle Rocket Stage 1, this mic is fully compatible with BLUE\'s acclaimed Bottle Caps, letting you interchange your capsules. Enjoy a new tonal range as you try out larger or smaller diaphragm capsules with varying pickups patterns on different sources. Low self-noise The Bottle Rocket Stage 1 has a very low self noise specification - less than 7.5dB - and a very high output level at +12dBV, making it a great choice for the high sample rate/deep word length digital platforms of today. Instead of using integrated circuits (IC\'s, also commonly called \"chips\"), the Stage 1 uses a transformerless Class A discrete amplifier circuit, giving it the most accurate, nose-free signal possible. SPECIFICATION Large diaphragm microphone Cardioid, omnidirectional, or figure-8 or pure pressure patterns, depending on capsule Frequency response: 20Hz - 20kHz Sensitivity: 1kHz into 2.5k1/2: 50mV/Pa (+-- 10mV depending on capsule) Max output: +12dBV Max SPL: 138dB Dynamic Range: 130dB Current draw: 1.8mA Compatible with BLUE Bottle Caps Excellent on a variety of sources, including vocals, electric guitars, acoustic guitars, strings, drums, and woodwinds Requires +48V phantom power We sell also Yamaha , Behringer , Korg, PA1000, Iphone , iPad, Logitech , Corsair , Acer ,PA1000MG , Studio interface , Audio Card , Microphone , Monitor , VSTi , Daw softwares , Boss , Alessis , Arabic Scale tunning , alesis, Alto , Midibeam , Maudio , Ketron , KRK , Montarbo , Roland , MRT audio,akai,Roland,m-audio,Marantz,sound system,lighting,keyboard.casio, Sony PS4 , Nintendo ,Wii , Xbox , Razer, Alienware , Jbl , Beats , Jabra , Bose , Sony headphones , Nikon ,Pioneer , Samsung , Gaming accessories , Asus laptop , Sony VR , VR headset , gaming , BMW, Marcedes , HyundaiKia,thrustmater,sades, and many good stuff<br><table class=\"scrap_ads_table\"><th>heading</th><th>value</th><tr><td>Condition</td><td>New</td></tr><tr><td>Type</td><td>Others</td></tr></table>', 'Blue Microphones Bottle Rocket', 'blue-microphones-bottle-rocket-2547', 'Malaysia', '', 'Kuala Lumpur', '20-lua Street 95, Kuala Lumpur Malaysia', '3.1478', '101.6953', 4016.815, 'MYR', 1, '0', 0, 0, NULL, 0, NULL, NULL, NULL, NULL, '2020-12-29 14:41:22', '2020-12-31 11:44:06', NULL, 'Ashako', NULL, NULL),
