 the biggest brands around. Whether you listen to MP3’s, lossless music, vinyl, or Spotify, you’ll hear new detail with Blue headphones. SPECIFICATION Patent pending 4-driver system featuring 2 custom 44mm ultra-responsive Blue dynamic drivers for audio and 2 dedicated 30mm drivers for ANC Built-in audiophile amplifier for rich, dynamic and detailed sound Highest quality Bluetooth® wireless technology Onboard controls for intuitive operation Sophisticated design for superior performance, sound isolation and comfort Foldable construction for easy portability and storage Battery life: up to 24 hours with Bluetooth only or 8 hours with Bluetooth, ANC and Amp Satellite continues to play music with included 3-meter audio cable even with no battery charge We sell also Yamaha , Behringer , Korg, PA1000, Iphone , iPad, Logitech , Corsair , Acer ,PA1000MG , Studio interface , Audio Card , Microphone , Monitor , VSTi , Daw softwares , Boss , Alessis , Arabic Scale tunning , alesis, Alto , Midibeam , Maudio , Ketron , KRK , Montarbo , Roland , MRT audio,akai,Roland,m-audio,Marantz,sound system,lighting,keyboard.casio, Sony PS4 , Nintendo ,Wii , Xbox , Razer, Alienware , Jbl , Beats , Jabra , Bose , Sony headphones , Nikon ,Pioneer , Samsung , Gaming accessories , Asus laptop , Sony VR , VR headset , gaming , BMW, Marcedes , HyundaiKia,thrustmater,sades, and many good stuff<br><table class=\"scrap_ads_table\"><th>heading</th><th>value</th><tr><td>Condition</td><td>New</td></tr><tr><td>Type</td><td>DJ Equipment</td></tr></table>', 'Blue Microphones Satellite Premium Wireles...', 'blue-microphones-satellite-premium-wireles-2657', 'Lithuania', '', 'Vilnius', '634-bau Street 169, Vilnius Lithuania', '54.6833', '25.2833', 487.142141, 'EUR', 1, '0', 0, 0, NULL, 0, NULL, NULL, NULL, NULL, '2020-12-29 14:41:22', '2020-12-31 11:44:07', NULL, 'Ashako', NULL, NULL),
