(2665, 117, 1, 'sell', 'The World\'s USB Microphone Create unparalleled recordings with your computer using Blue\'s best-selling Yeti family of USB microphones. Thanks to our proprietary tri-capsule technology, Yeti microphones produce pristine, studio-quality recordings with legendary ease. And four different pattern settings offer incredible flexibility so you can record vocals, music, podcasts, audio for video, interviews, or even cryptozoology lectures in ways that would normally require multiple microphones. Whether you\'re recording at home, on the road, or in the Himalayas, Yeti helps you produce studio-quality recordings every time. Yeti for Any Application From professional podcasting to music recording, gaming, and even audio for video, Yeti carries your projects to studio-quality heights. Blue Microphones\' proprietary tri-capsule technology gives you four distinct pattern modes to choose from Pattern MODES:: CARDIOID MODE : Perfect for podcasts, game streaming, vocal performances, voice-overs and instruments. Cardioid mode records sound sources that are directly in front of the microphone, delivering rich, full-bodied sound. STEREO MODE : Uses both the left and right channels to capture a wide, realistic sound image—ideal for recording acoustic guitar or choir. OMNIDIRECTIONAL MODE : Picks up sound equally from all around the mic. It’s best used in situations when you want to capture the ambience of \"being there\"—like recording a band\'s live performance, a multi-person podcast or a conference call. BIDIRECTIONAL MODE : Records from both the front and rear of the microphone—good for recording a duet or a two-person interview. Total Recording Control with Yeti Yeti features studio controls for headphone volume, pattern selection, instant mute and microphone gain—putting you in charge of every level of the recording process. If you’re experiencing distortion or feedback while recording an especially loud source—like the deafening sound of an avalanche—simply adjust the microphone\'s sensitivity with the gain control. Or if you want to take a break in the middle of a podcast, use the instant mute button. The microphone comes equipped with a 3.5-millimeter headphone jack that allows you to listen to what you\'re recording in real-time, without latency delays—that means no more hearing a note 3 seconds after you played it. You can adjust the volume of your headphones using the control on the front of the microphone. Innovative Design Makes Recording Easy We sell also Yamaha , Behringer , Korg, PA1000, Iphone , iPad, Logitech , Corsair , Acer ,PA1000MG , Studio interface , Audio Card , Microphone , Monitor , VSTi , Daw softwares , Boss , Alessis , Arabic Scale tunning , alesis, Alto , Midibeam , Maudio , Ketron , KRK , Montarbo , Roland , MRT audio,akai,Roland,m-audio,Marantz,sound system,lighting,keyboard.casio, Sony PS4 , Nintendo ,Wii , Xbox , Razer, Alienware , Jbl , Beats , Jabra , Bose , Sony headphones , Nikon ,Pioneer , Samsung , Gaming accessories , Asus laptop , Sony VR , VR headset , gaming , BMW, Marcedes , HyundaiKia,thrustmater,sades, and many good stuff<br><table class=\"scrap_ads_table\"><th>heading</th><th>value</th><tr><td>Condition</td><td>New</td></tr><tr><td>Type</td><td>Pianos & Keyboards</td></tr></table>', 'Blue Microphones Yeti Usb Microphone', 'blue-microphones-yeti-usb-microphone-2665', 'Australia', '', 'Canberra', '185-sda Street 262, Canberra Australia', '-35.2931', '149.1269', 286.19514, 'AUD', 1, '0', 0, 0, NULL, 0, NULL, NULL, NULL, NULL, '2020-12-29 14:41:22', '2020-12-31 11:44:07', NULL, 'Ashako', NULL, NULL),
